import './App.css';
import RootLayout from './RootLayout';
import {
  createBrowserRouter,
  createRoutesFromElements,
  RouterProvider,
  Route,
} from "react-router-dom";

const router = createBrowserRouter(
  createRoutesFromElements(
    <Route path="/" element={<RootLayout />} >
      <Route index element={<Home />} />
      <Route path='create' element={<Create />} />
    </Route>
  )
);

function App() {
  return (
    <h1>zaid</h1>
  );
}

export default App;
